import React, { Component } from 'react';
import plaid from 'plaid';
import $ from 'jquery';

class App extends Component {
  constructor (props) {
    super(props);
    this.handler = plaid.create({
      clientName: 'Fin Dash',
      env: 'sandbox',
      product: 'transactions',
      key: props.key,
      countryCodes: 'US'.split(','),
      // webhook: 'https://your-domain.tld/plaid-webhook',
      onSuccess: public_token => {
        $.post('/get_access_token', {
          public_token: public_token
        });
      }
    });
  }

  showLink () {
    this.handler.open();
  }
  render () {
    return (
      <React.Fragment>
        <form id='plaid-link-form'></form>
        <script src="https://cdn.plaid.com/link/v2/stable/link-initialize.js"
        data-client-name="Fin_dash" data-form-id="plaid-link-form"
        data-key={this.props.public_key} data-product="auth"
        data-env="sandbox"></script>
        <button id="link-btn" onClick={this.showLink}>Link</button>
      </React.Fragment>
    );
  }
}

export default App;
